value.ProtestoData:
={{ 
  (() => {
    const raw = $('SERASA - CNPJ').isExecuted ? $('SERASA - CNPJ').item.json.protesto_data : '';
    if (!raw || raw.length < 7) return 'N/A';
    const str = raw.padStart(8, '0');
    return `${str.substring(0,2)}/${str.substring(2,4)}/${str.substring(4)}`;
  })() 
}}

